-- ----------------------------
-- View structure for v_book_basic_info
-- ----------------------------
DROP VIEW IF EXISTS `v_book_basic_info`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_book_basic_info` AS select `b`.`BookID` AS `BookID`,`b`.`Title` AS `Title`,`b`.`Publisher` AS `Publisher`,`b`.`Price` AS `Price`,`b`.`StockQuantity` AS `StockQuantity` from `book` `b`;

-- ----------------------------
-- View structure for v_book_detail
-- ----------------------------
DROP VIEW IF EXISTS `v_book_detail`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_book_detail` AS select `b`.`BookID` AS `BookID`,`b`.`Title` AS `Title`,`b`.`Publisher` AS `Publisher`,`b`.`Price` AS `Price`,group_concat(distinct `a`.`Name` order by `ba`.`AuthorOrder` ASC separator ', ') AS `Authors`,group_concat(distinct `k`.`Word` separator ', ') AS `Keywords`,`b`.`StockQuantity` AS `StockQuantity` from ((((`book` `b` left join `bookauthor` `ba` on((`b`.`BookID` = `ba`.`BookID`))) left join `author` `a` on((`ba`.`AuthorID` = `a`.`AuthorID`))) left join `bookkeyword` `bk` on((`b`.`BookID` = `bk`.`BookID`))) left join `keyword` `k` on((`bk`.`KeywordID` = `k`.`KeywordID`))) group by `b`.`BookID`;

-- ----------------------------
-- View structure for v_customer_info
-- ----------------------------
DROP VIEW IF EXISTS `v_customer_info`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_customer_info` AS select `customer`.`CustomerID` AS `CustomerID`,`customer`.`Name` AS `Name`,`customer`.`Address` AS `Address`,`customer`.`Balance` AS `Balance`,`customer`.`CreditLevel` AS `CreditLevel` from `customer`;

-- ----------------------------
-- View structure for v_customer_orders
-- ----------------------------
DROP VIEW IF EXISTS `v_customer_orders`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_customer_orders` AS select `o`.`OrderID` AS `OrderID`,`o`.`CustomerID` AS `CustomerID`,`o`.`OrderDate` AS `OrderDate`,`o`.`Status` AS `Status`,`o`.`TotalAmount` AS `TotalAmount` from `orders` `o`;

-- ----------------------------
-- View structure for v_order_items_detail
-- ----------------------------
DROP VIEW IF EXISTS `v_order_items_detail`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_order_items_detail` AS select `oi`.`OrderID` AS `OrderID`,`b`.`Title` AS `Title`,`oi`.`BookID` AS `BookID`,`oi`.`Quantity` AS `Quantity`,`oi`.`UnitPrice` AS `UnitPrice`,`oi`.`Amount` AS `Amount` from (`orderitem` `oi` join `book` `b` on((`oi`.`BookID` = `b`.`BookID`)));

-- ----------------------------
-- View structure for v_shipment_detail
-- ----------------------------
DROP VIEW IF EXISTS `v_shipment_detail`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_shipment_detail` AS select `s`.`ShipmentID` AS `ShipmentID`,`s`.`OrderID` AS `OrderID`,`s`.`BookID` AS `BookID`,`b`.`Title` AS `Title`,`s`.`Quantity` AS `Quantity`,`s`.`ShipDate` AS `ShipDate`,`s`.`TrackingNo` AS `TrackingNo` from (`shipment` `s` join `book` `b` on((`s`.`BookID` = `b`.`BookID`)));

-- ----------------------------
-- Procedure structure for AdjustCustomerCreditMonthly
-- ----------------------------
DROP PROCEDURE IF EXISTS `AdjustCustomerCreditMonthly`;
delimiter ;;
CREATE PROCEDURE `AdjustCustomerCreditMonthly`()
BEGIN
    /*
      根据当前 Balance 批量调整客户信用等级和透支额度（示例规则）：
        Balance >= 5000       → Level 5, MonthlyLimit = 3000
        3000 <= Balance < 5000 → Level 4, MonthlyLimit = 2000
        1500 <= Balance < 3000 → Level 3, MonthlyLimit = 1000
        800  <= Balance < 1500 → Level 2, MonthlyLimit = 0
        else                   → Level 1, MonthlyLimit = 0
    */

    -- 等级 5
    UPDATE Customer
    SET CreditLevel = 5,
        MonthlyLimit = 3000
    WHERE Balance >= 5000;

    -- 等级 4
    UPDATE Customer
    SET CreditLevel = 4,
        MonthlyLimit = 2000
    WHERE Balance >= 3000 AND Balance < 5000;

    -- 等级 3
    UPDATE Customer
    SET CreditLevel = 3,
        MonthlyLimit = 1000
    WHERE Balance >= 1500 AND Balance < 3000;

    -- 等级 2
    UPDATE Customer
    SET CreditLevel = 2,
        MonthlyLimit = 0
    WHERE Balance >= 800 AND Balance < 1500;

    -- 等级 1
    UPDATE Customer
    SET CreditLevel = 1,
        MonthlyLimit = 0
    WHERE Balance < 800;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for CreateOrder
-- ----------------------------
DROP PROCEDURE IF EXISTS `CreateOrder`;
delimiter ;;
CREATE PROCEDURE `CreateOrder`(IN pCustomerID INT,
    IN pShippingAddress VARCHAR(300))
BEGIN
    DECLARE vOrderID INT;

    START TRANSACTION;

    -- 创建订单主表记录
    INSERT INTO Orders(CustomerID, ShippingAddress) 
    VALUES(pCustomerID, pShippingAddress);

    SET vOrderID = LAST_INSERT_ID();

    -- OrderItem 表中的订单项内容由业务层提前插入到临时表 temp_order_item
    -- 结构：BookID, Quantity

    -- 插入订单项
    INSERT INTO OrderItem(OrderID, BookID, Quantity, UnitPrice)
    SELECT 
        vOrderID AS OrderID,
        t.BookID,
        t.Quantity,
        b.Price
    FROM temp_order_item t
    JOIN Book b ON t.BookID = b.BookID;

    -- 更新库存
    UPDATE Book b
    JOIN temp_order_item t ON b.BookID = t.BookID
    SET b.StockQuantity = b.StockQuantity - t.Quantity;

    -- 自动生成缺书记录
    INSERT INTO ShortageRecord(BookID, Quantity, Date, SourceType)
    SELECT 
        b.BookID,
        ABS(b.StockQuantity),
        NOW(),
        'Order'
    FROM Book b
    WHERE b.StockQuantity < 0;

    COMMIT;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for ReceivePurchase
-- ----------------------------
DROP PROCEDURE IF EXISTS `ReceivePurchase`;
delimiter ;;
CREATE PROCEDURE `ReceivePurchase`(IN pPOID INT)
BEGIN
    START TRANSACTION;

    -- 更新库存
    UPDATE Book b
    JOIN PurchaseItem pi ON b.BookID = pi.BookID
    SET b.StockQuantity = b.StockQuantity + pi.Quantity
    WHERE pi.POID = pPOID;

    -- 更新采购单状态
    UPDATE PurchaseOrder
    SET Status = 'Arrived'
    WHERE POID = pPOID;

    -- 标记相关缺书记录已处理
    UPDATE ShortageRecord sr
    JOIN PurchaseItem pi ON sr.BookID = pi.BookID
    SET sr.Processed = 1
    WHERE pi.POID = pPOID;

    COMMIT;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for UpdateOrderTotal
-- ----------------------------
DROP PROCEDURE IF EXISTS `UpdateOrderTotal`;
delimiter ;;
CREATE PROCEDURE `UpdateOrderTotal`(IN pOrderID INT)
BEGIN
    UPDATE Orders
    SET TotalAmount = (
        SELECT SUM(Amount)
        FROM OrderItem
        WHERE OrderID = pOrderID
    )
    WHERE OrderID = pOrderID;
END
;;
delimiter ;

-- ----------------------------
-- Event structure for ev_adjust_customer_credit_monthly
-- ----------------------------
DROP EVENT IF EXISTS `ev_adjust_customer_credit_monthly`;
delimiter ;;
CREATE EVENT `ev_adjust_customer_credit_monthly`
ON SCHEDULE
EVERY '1' MONTH STARTS '2025-12-01 00:05:00'
DO CALL AdjustCustomerCreditMonthly()
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
